FYI&lt; this seems to work:

history.pushState(null, document.title, location.href);
window.addEventListener('popstate', function (event) {
      history.pushState(null, document.title, location.href);
});

I was using this js to prevent use of the back button during studies (for the last few years):

history.pushState(null, null, location.href); 
history.back(); 
history.forward(); 
window.onpopstate = function () { history.go(1); };

Suddenly today it constantly reloads the page. https://t.co/ueI7hZ1Tu6

